import Container from '@material-ui/core/Container';

const App = props => {
	return (
		<>
			<Grid container direction='row-reverse' className='header'>
				<Container>
					<Grid item xs={3}>
						تیزتایپ
					</Grid>
					<Grid item xs={6} />
					<Grid item xs={3}>
						خانه
					</Grid>
				</Container>
			</Grid>
		</>
	);
};

export default App;
